Do you give yourself permission to let loose?  Or are you like me, always saying things like “No”, “Not yet”, “After I’ve finished this [email/laundry/cooking]” if the kids ask you to play a game with them? That’s not the kind of parent I envisaged myself being. But does that magical time ever eventuate, when you have nothing else to do but a round of UNO?

It’s easy to get absorbed by the never-ending to-do list, it seems impossible just to let it all go and have some fun without feeling guilty thinking about all the things you have to do.

So I say: Put away the to-do list, tune into your carefree self and make a plan to laugh with loved ones this weekend. 

Play a board game, a card game, build some Lego, draw a picture, colour-in, have a lounge room dance party, kick a footy, jump on the trampoline, throw a frisbee...

What do you do, just for fun? 

